module.exports = {
  env: {
    es6: true,
    node: true,
  },
  parser: '@typescript-eslint/parser',
  plugins: ['@typescript-eslint', 'react'],
  extends: [
    'eslint:recommended',
    'plugin:@typescript-eslint/eslint-recommended',
    'plugin:@typescript-eslint/recommended',
    'prettier/@typescript-eslint',
    'plugin:prettier/recommended',
  ],
  globals: {
    App: true,
  },
  parserOptions: {
    ecmaFeatures: {
      jsx: true,
    },
  },
  settings: {
    react: {
      version: 'detect',
    },
  },
  rules: {
    'no-case-declarations': [0],
    'require-atomic-updates': [0],
    '@typescript-eslint/explicit-function-return-type': [0],
    '@typescript-eslint/no-explicit-any': [0],
    '@typescript-eslint/explicit-member-accessibility': [0],
    '@typescript-eslint/no-non-null-assertion': [0],
    '@typescript-eslint/triple-slash-reference': [0],
    '@typescript-eslint/ban-ts-comment': [0],
    'react/jsx-uses-vars': 2,
    '@typescript-eslint/array-type': [2, { default: 'array-simple' }],
    '@typescript-eslint/no-var-requires': [0],
    '@typescript-eslint/no-unused-vars': [0],
    '@typescript-eslint/explicit-module-boundary-types': [0],
  },
};

module.exports = {
  extends: ['@commitlint/config-conventional'],
  rules: {
    'scope-enum': [2, 'always', ['cli', 'ali', 'wechat', 'remax', 'toutiao', 'one', 'web']],
    'type-enum': [
      2,
      'always',
      ['build', 'ci', 'chore', 'docs', 'feat', 'fix', 'perf', 'refactor', 'revert', 'style', 'test', 'deps'],
    ],
  },
};

{
  "command": {
    "publish": {
      "conventionalCommits": true,
      "exact": true,
      "forcePublish": true,
      "private": false
    }
  },
  "version": "2.15.14",
  "npmClient": "yarn",
  "useWorkspaces": true
}

const micromatch = require('micromatch');

module.exports = {
  '*.{ts,tsx}': ['eslint --fix', 'prettier --write', 'git add'],
  '*.{md,js,jsx}': files => {
    const match = micromatch.not(files, ['**/__tests__/**/expected/**/*.js', '**/tests/fixtures/**/output.js']);
    return match.length > 1 ? [`prettier ${match.join(' ')} --write`, `git add ${match.join(' ')}`] : [];
  },
};

{
  "version": 2,
  "name": "remax-website",
  "builds": [
    {
      "src": "website/package.json",
      "use": "@now/static-build"
    }
  ],
  "routes": [
    {
      "src": "/(.*)",
      "dest": "/website/$1",
      "continue": true
    }
  ]
}

{
  "compilerOptions": {
    "module": "ESNext",
    "target": "es5",
    "strict": true,
    "composite": true,
    "noImplicitAny": true,
    "esModuleInterop": true,
    "moduleResolution": "node",
    "noUnusedLocals": true,
    "skipLibCheck": true
  }
}

{
  "files": [],
  "references": [
